// code will hold the go code after script execution
let code = '';

const nameToMethodName = function (cityName) {
	return cityName.replace(/\s/g,'')
	.replace("'", "")
	.replace(".", "")
	.replace("-", "")
	.replace(",", "")
	.replace("’", "")
	.replace("-", "")
	.replace(".", "")
	.replace("(", "")
	.replace(")", "")
	.replace("/", "")
	.replace("-", "")
	.replace("‘", "")	
	;
}

data.countries.forEach(function (country) {
	const countryName = country.name

	country.cities.forEach(function (city) {
		const cityId = city.id;
		const cityName = nameToMethodName(city.name);
		const methodName = nameToMethodName(country.name) + nameToMethodName(city.name)
		
		code += `
			// ${methodName} returns id for ${cityName} city in ${countryName}
			func (c City) ${methodName}() string {
				return "${cityId}"
			}
		`;
	});
});